export class NixieDigit extends HTMLElement {
	static sprites = "0123456789.:";
	static observedAttributes = ["value"];
	static sheet = NixieDigit.createSheet();

	constructor() {
		super();
	}

	connectedCallback() {
		const dom = this.attachShadow({ mode: "closed" });
		dom.adoptedStyleSheets = [NixieDigit.sheet];

		var cont = document.createElement("div");
		cont.className = "nx-container";
		this.digits = [document.createElement("div"), document.createElement("div")];
		this.digits[0].className = this.digits[1].className = "nx nx-10";
		cont.appendChild(this.digits[0]);
		cont.appendChild(this.digits[1]);
		dom.appendChild(cont);

		this.currentIndex = 10;
		this.previousIndex = 10;

		this.render();
	}

	attributeChangedCallback(_attribute, _previousValue, currentValue) {
		const index = NixieDigit.sprites.indexOf(currentValue);
		if (-1 === index) return;

		this.currentIndex = index;
		if (!this.digits) return;

		this.render();
	}

	render() {
		if (this.timer) clearTimeout(this.timer);
		this.timer = undefined;

		if (this.currentIndex === this.previousIndex) return;

		this.digits[0].className = "nx nx-" + this.currentIndex;
		this.digits[1].className = "nx nx-" + this.previousIndex;
		this.previousIndex = this.currentIndex;
		this.timer = setTimeout(() => this.digits[1].classList.add("nx-fade-out"));
	}

	static createSheet() {
		const sheet = new CSSStyleSheet();
		sheet.replaceSync(`
		.nx, .nx-container {
			display: inline-block;
			width: 121px;
			height: 199px;
		}
		.nx-0 { background-position: -43px 0; }
		.nx-1 { background-position: -164px 0; }
		.nx-2 { background-position: -285px 0; }
		.nx-3 { background-position: -406px 0; }
		.nx-4 { background-position: -43px -199px; }
		.nx-5 { background-position: -164px -199px; }
		.nx-6 { background-position: -285px -199px; }
		.nx-7 { background-position: -406px -199px; }
		.nx-8 { background-position: -43px -398px; }
		.nx-9 { background-position: -164px -398px; }
		.nx-10 { background-position: -285px -398px; }
		.nx-11 { background-position: -406px -398px; }
		.nx-container {
			position: relative;
			background: black;
		}
		.nx-container .nx {
			position: absolute;
		}
		.nx-container .nx-fade-out {
			animation: nx-fadeOut 0.5s ease-out forwards;
		}
		@keyframes nx-fadeOut {
			from { opacity: 1; }
			to { opacity: 0; }
		}
		.nx {
			background-repeat: no-repeat;
			/*
			Beautiful Nixie tube image "The real Nixie tube indicator a set of decimal digits" by LLEPOD
			https://depositphotos.com/photo/the-real-nixie-tube-indicator-a-set-of-decimal-digits-45965467.html
			License: Royalty-free for personal and commercial purposes, see https://depositphotos.com/license.html
			*/
		    background-image: url(data:image/webp;base64,);
		}		
	`);
		return sheet;
	}
}

customElements.define("nixie-digit", NixieDigit);